import React from "react";

const CountryList = ({data}) => {
    
    const handleShow = () => {
        console.log("clicked");
    }
    
    return data.map(country => 
        <div key={country.name.common}>
            <p>{country.name.common}</p>
            <button onClick={handleShow}>show</button>
        </div>);
}

export default CountryList;
